@BBCAfrica: Elite Kenyan long-distance runner Eliud Kipchoge has partnered up with Nike to launch a new footwear and apparel collection. 

Named “EK Umoja”, it features eight pieces, inspired by his 2003 World Athletic Championships victory and Kenyan heritage.

